import React, { Component } from 'react';

export default class index extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
    };
  }
  componentDidMount() {
    this.showData();
  }

  async showData() {
    await fetch('http://localhost:5000/api/v1/eintraege').then((data) =>
      (data = data.json()).then((data) => this.setState({ data: [...data] }))
    );
  }
  render() {
    let { data } = this.state;
    return <div>{data.map((item) => JSON.stringify(item))}</div>;
  }
}
